import './about.css';


export default function About() {
    return (
        <div className="about2">
            <h1 className='h1'>About Smartex</h1>
           <p className='para'>SMARTEX is a congregation of smart minds and products endeavored as a symposium & expo, focusing on smart design, emerging technologies, and innovation in the realm of architecture & interior design.

This symposium is an engaging plethora that brings people together, becoming a driving force to encourage the architectural and innovative works of the nation. An initiative by Building Material Reporter (BMR) and industry experts serving as curators, it comes with a unique theme and agenda concentrating on smart innovation. </p>
           
        </div>
    );
}
